  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains physical, chemical,
  and biological data collected during ten years of near-monthly shipboard surveys
  carried out in Mobile Bay between May 1989 and December 1999. Station locations
  ranged from the Mobile River delta to the mouth of Mobile Bay, from Bon Secour to
  the eastern part of Mississippi Sound, and outside Mobile Bay in the northern Gulf
  of Mexico. Hydrographic profiles and water samples were collected at each station.nnPurpose:
  To examine the effects of river discharge, suspended sediment dynamics, and nutrient
  inputs on phytoplankton production in the Mobile Bay ecosystem.\",\n\t\"license_title\":
